import React, { Component } from 'react';
import home from "../images/homeIcon.png";
import '../App.css';


class Footer extends Component {
    render() {
      return (
        <div className="landingPage">
          <div className="home">
            <img src={home} className="homeButton" alt="logo"/>
          </div>
        </div>
      );
    }
  }

  export default Footer;
